import React, {Component} from 'react';
import './Menu.css';
import SlideToggle from 'react-slide-toggle';

const Menu = () => (
	<SlideToggle
		duration={800}
		progress={0}
		render={({ toggle, setCollapsibleElement, progress }) => (
			<div className="Menu">
				<div className="slide-toggle__header">
					<button className="slide-toggle__button" onClick={toggle}>Menu</button>
				</div>
				<div className="slide-toggle__box" ref={setCollapsibleElement}>
					<div className="slide-toggle__box-inner" style={{ opacity: Math.max(0.5, progress) }}>
						<div className={'menu-items'} ref={'menu-items'}>
							<a className={'menu-item'}>About</a>
							<a className={'menu-item'}>Skills</a>
							<a className={'menu-item'}>Portfolio</a>
							<a className={'menu-item'}>Contact</a>
						</div>
					</div>
				</div>
			</div>
		)}
	/>
);

export default Menu;
